import React from 'react';
import { Link } from 'react-router-dom';

const Landing = () => {
  return (
    <div style={{ 
      minHeight: '100vh',
      padding: '2rem',
      backgroundColor: '#f5f5f5'
    }}>
      <h1 style={{ color: '#333', textAlign: 'center' }}>SafeReport</h1>
      <p style={{ textAlign: 'center', fontSize: '1.2rem' }}>
        A Safe Space to Report Harassment and Get Support
      </p>
      <div style={{ textAlign: 'center', marginTop: '2rem' }}>
        <Link 
          to="/login" 
          style={{
            backgroundColor: '#007bff',
            color: 'white',
            padding: '12px 24px',
            textDecoration: 'none',
            borderRadius: '5px',
            display: 'inline-block'
          }}
        >
          Get Started
        </Link>
      </div>
    </div>
  );
};

export default Landing;
